import React from "react";
import Card from "./Card";
import tvd_pic from "./tvd_pic.jpg";
import mentalist_pic from "./mentalist_pic.jpg";
import mirzapur_pic from "./mirzapur_pic.jpg";

function App2() {
	return (
		<>
			<Card
				sname="The Vampire Diaries"
				imgsource={tvd_pic}
				links="https://www.primevideo.com/detail/0HOK2IOF5E6RFUO8LL6L4LAW3W/ref=atv_dp_season_select_s1"
				title="Amazon Original Series"
			/>
			<Card
				sname="The Mentalist"
				imgsource={mentalist_pic}
				links="https://www.primevideo.com/detail/0FJTYK2JJYPK3ZA10FUT08RXXI/ref=atv_dp_season_select_s1"
				title="Amazon Series"
			/>
			<Card
				sname="Mirzapur"
				imgsource={mirzapur_pic}
				links="https://www.primevideo.com/detail/0PDOKMV9CRLOMO5EUKNCUJLG4Q/ref=atv_tv_hom_c_dfByPd_3_4"
				title="Amazon Original Series"
			/>
		</>
	);
}
export default App2;
